import React from 'react';
import './App.css';

function Cart() {
  return (
    <div className="container">
      <h2>Your Cart</h2>

      <div className="product-card">
        <img src="/images/laptop1.jpg" alt="Ultrabook Pro" />
        <h3>Ultrabook Pro</h3>
        <p>Intel i7, 16GB RAM, 512GB SSD</p>
        <p><strong>$1299</strong></p>
        <button style={{ padding: '8px 16px', marginTop: '10px' }}>Remove</button>
      </div>

    </div>
  );
}

export default Cart;
